import React from "react";
import { SiHtml5 } from "react-icons/si";
import styled from "styled-components";
import palette from "../lib/styles/palette";

const skills = [
  {
    id: 1,
    img: <SiHtml5 />,
    category: "Front-end",
    level: 5,
  },
];

const SkillList = () => {
  return skills.map((skill) => <Skill key={skill.id} skill={skill}></Skill>);
};

const Skill = ({ skill }) => {
  console.log(skill);
  return (
    <SkillItem>
      {skill.id}
      {skill.img}
    </SkillItem>
  );
};

const SkillItem = styled.div`
  color: ${palette.white};
`;

export default SkillList;
